import{_ as e,c as a,o as t,V as o}from"./chunks/framework.249fa23d.js";const m=JSON.parse('{"title":"PDF Image Plugin","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Plugin_Image_PDF.md","filePath":"guide/Plugin_Image_PDF.md","lastUpdated":1706778247000}'),i={name:"guide/Plugin_Image_PDF.md"},s=o('<h1 id="pdf-image-plugin" tabindex="-1">PDF Image Plugin <a class="header-anchor" href="#pdf-image-plugin" aria-label="Permalink to &quot;PDF Image Plugin&quot;">​</a></h1><p>The renderer of Mogan doesn&#39;t support PDF images. Such PDF images are usually PDF vector graphics, made by third-party software (such as exporting to PDF vector graphics in Octave or Maxima).</p><p>When Mogan renders PDF images, it relies on Ghostscript to convert PDF images to PNG images. Therefore, this plugin requires users to manually install Ghostscript.</p><h2 id="how-to-install-ghostscript" tabindex="-1">How to install Ghostscript <a class="header-anchor" href="#how-to-install-ghostscript" aria-label="Permalink to &quot;How to install Ghostscript&quot;">​</a></h2><h3 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h3><p>Go to the <a href="https://www.ghostscript.com" target="_blank" rel="noreferrer">Ghostscript official website</a> to download the installation package and install it to the system C drive according to the default path.</p><p>If users didn&#39;t install according to the default path, they need to manually add the directory where <code>gs.exe</code> is located to the PATH.</p><h3 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h3><p>Use <code>brew install ghostscript</code> to install.</p><h3 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h3><p>Use <code>sudo apt install ghostscript</code> or other ways to install.</p>',11),r=[s];